import React, { useEffect, useState } from 'react';
import {
  Button,
  Window,
  WindowContent,
  WindowHeader,
  TextInput
} from 'react95';


export default ({setShowNapster}) => {
  const sites = [
    {
      'title': ''
    }
  ]
  return (
    <>
      <Window style={{width: '550px', height: '450px'}} resizable className='window'>
        <WindowHeader style={{
          display: 'flex',
          justifyContent: 'space-between'
        }}>
          <span>America Online - You've got mail!</span>
          <Button style={{marginTop: '2px'}} onClick={()=>{
            setShowNapster(false)}}>
            <b>x</b>
          </Button>
        </WindowHeader>
        <WindowContent>
          <iframe style={{
            width: '100%',
            height: '360px'
          }} src='/'></iframe>
        </WindowContent>
      </Window>

    </>
  );
}
